import React from 'react';
import { View, Text, Button } from 'react-native';
import ScreenTemplate from '../../screenTemplate';
import styles from './StudySpacesStyle';

export default function StudySpacesNav2() {
    return (
      <ScreenTemplate>
        <View style={styles.headerContainer}>
            <Text style={styles.header}>Room Availability</Text>
        </View>
        <View style={styles.spaces}>
            <Button style={styles.buttons}
                title="Small Space (2-5 people)"
                // onPress={() => Alert.alert('Small Space Slected')}
                color= "rgb(92, 92, 92)"
                padding= "5%"
            />
            {/* <Separator/> */}
            <Button style={styles.buttons}
                title="Large Space(4-8 people)"
                // onPress={() => Alert.alert('Large Space Slected')}
                color="rgb(92, 92, 92)"
                padding="5%"
            />
            </View>
      </ScreenTemplate>
    );
  }
